import React from 'react';
import tree from './tree.svg';

class Header extends React.Component {
    /**
     * Do your thang here
     */
    render() {
        return (
            <div className="container">
                
                <div className="jumbotron bg-white mb-10">
                    <div className="d-inline text-center">
                        <img src={tree} style={{width: 100 + 'px'}} className="align"></img>
                    </div>
                    <div className="d-inline h2 text-center">
                        Speak4Env!
                    </div>
                    <hr className="my-4"/>
                    <p className="lead">Speak4Env gives you the opportunity to express and share with others your thoughts and ideas about improving our planet. Let's make it a better place for all of us!</p>
                </div>



            </div>
        );
    }
}

export default Header;
